import { Container, Row, Col} from 'react-bootstrap';
import './TodoItem.css';

function TodoItem({todo, onDelete}) {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <img src="../Assests/circle.png" alt="" fluid/>
                    <p className='Todo-text'>{todo.text}</p>
                    <img className='Todo-cancel' src="../Assests/icon-cross.svg" alt="" onClick={() => onDelete(todo.id)}/>
                </Col>
            </Row>
        </Container>
    );
}

export default TodoItem;
